import React, { useState, useEffect } from 'react';
import Background from '../assets/movies2.jpg';
import './Login.css';
import axios from 'axios';
import { Button, FormGroup, FormControl } from "react-bootstrap";

export default function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function validateForm() {
    return email.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
  }

  return (
    <div className="Login">
      <form onSubmit={handleSubmit}>
        <FormGroup controlId="email" bsSize="large" className="text-container">
          <p className="label">Email</p>
          <FormControl className="text-box"
            autoFocus
            type="email"
            value={email}
            onChange={e => setEmail(e.target.value)}
          />
        </FormGroup>
        <FormGroup controlId="password" bsSize="large" className="text-container">
          <p className="label">Password</p>
          <FormControl className="text-box"
            value={password}
            onChange={e => setPassword(e.target.value)}
            type="password"
          />
        </FormGroup>
        <Button block bsSize="large" className="button" disabled={!validateForm()} type="submit">
          Login
        </Button>
      </form>
    </div>
  );
}
